import { StyleSheet } from "react-native"

const styles = StyleSheet.create({

    formContext: {
        width: "100%",
        height: "100%",
        bottom: 0,
        backgroundColor: "#ffffff",
        alignItems: "center",
        borderTopLeftRadius: 30,
        borderTopRightRadius: 30,
        marginTop: 30,

    },
    form: {
        width: "100%",
        height: "auto",
        marginTop: 30,
        padding: 10,

    },
    formLabel: {
        color: "#000000",
        fontSize: 18,
        paddingLeft: 20,


    },
    input:{
        width:"90%"
    }

});

export default styles
